giH(){return"\u03a0\u03bb\u03bf\u03ae\u03b3\u03b7\u03c3\u03b7 \u03ba\u03ac\u03c4\u03c9 \u03bc\u03ad\u03c1\u03bf\u03c5\u03c2 \u03bc\u03b5 \u03c0\u03c1\u03bf\u03b2\u03bf\u03bb\u03ad\u03c2 \u03c3\u03c4\u03b1\u03b4\u03b9\u03b1\u03ba\u03ae\u03c2 \u03bc\u03b5\u03c4\u03ac\u03b2\u03b1\u03c3\u03b7\u03c2"},
gcq(){return"\u039c\u03cc\u03bd\u03b9\u03bc\u03b5\u03c2 \u03b5\u03c4\u03b9\u03ba\u03ad\u03c4\u03b5\u03c2"},
